import React from 'react';

const HomePage = () => {
    return (
        <div>
            <h1>Food Recipes</h1>
              <table>
              <thead>
                  <tr>
                  <th>ID</th>
                  <th>Name</th>
                  </tr>
              </thead>
              <tbody>
                  {data.map(item => (
                  <tr key={item.id}>
                      <td>{item.id}</td>
                      <td>{item.name}</td>
                  </tr>
                  ))}
              </tbody>
              </table>
        </div>
    );
};

export default HomePage;
